/**
 * Navigation
 */

.toggle-menu {  
    border: none; 
    display: block;
    font-size: 30px;
    font-weight: 700;
    outline: none;
    padding: 5px;
    text-align: center; 
    height: 36px;
    width: 36px;
}

.toggle-menu.toggle-menu--close .icon-menu:before {
    content: "\e915"; 
}

    .nav-primary {
        background-color: #333; 
        padding: 0;
        margin: 0; 
        width: 100%;
        list-style-type: none; 
        display: none;                     
    } 

        .nav-primary .sub-menu-toggle {
            content: "";
            color: #fff;
            cursor: pointer;
            font-size: 16px;
            font-weight: 400;
            width: 38px;
            height: 38px;
            line-height: 38px; 
            position: absolute;
            right: 0;
            top: 0;
            display: block;
            text-align: center;

            -webkit-transition: all .4s ease;
                 -o-transition: all .4s ease;
                    transition: all .4s ease;
        }

        .nav-primary .sub-menu-toggle.js-toggled {
            -webkit-transform: rotate(-180deg);
                -ms-transform: rotate(-180deg);
                 transform: rotate(-180deg);
        }

        .nav-primary li {
            border-top: 1px solid #ccc; 
            position: relative;
            text-transform: uppercase;

        }

        .nav-primary a {
            color: var(--color-tertiary);
            display: block;
            padding: 8px 10px 8px 15px;
            -webkit-transition: all .4s ease-in-out;
            -o-transition: all .4s ease-in-out;
            transition: all .4s ease-in-out;    
            text-decoration: none;            
        }

        .nav-primary a:hover {
            color: var(--color-secondary); 
        }



        @media(min-width: 1025px) {
            .nav-primary { 
                background-color: transparent;
                display: block; 
                width: auto;
            } 
                .nav-primary .sub-menu-toggle {
                    color: var(--color-body);
                    font-size: 22px;
                    height: 50px;
                    line-height: 50px;
                }

                .nav-primary a {
                    color: var(--color-primary);
                }

                .nav-primary li {
                    display: block;
                    float: left;
                    border-top: 0;
                }

